import Box from "@mui/material/Box";
import { useState } from "react";

const ShowBox = () => {
  const [side, siedChage] = useState("left");

  return (
    <>
      {side === "right" ? (
        <Box
          className="right-box"
          sx={{
            width: "auto",
            maxWidth: "450px",
            height: "70px",
            backgroundColor: "white",
          }}
        >
          hello
        </Box>
      ) : (
        <Box
          className="left-box"
          sx={{
            width: "auto",
            maxWidth: "450px",
            height: "70px",
            backgroundColor: "white",
          }}
        >
          hello
        </Box>
      )}

      <Box
        sx={{
          width: "auto",
          height: 500,
          alignItems: "center",
          backgroundColor: "white",
          margin: "auto",
        }}
      ></Box>
    </>
  );
};

export default ShowBox;
